import React from 'react'
import styled from 'styled-components'

const CategoryItem = ({item}) => {
    const Container = styled.div``;
  return (
    <Container>
        <Image src={item.img}/>
        <Info>
            <Title>{item.title}</Title>
            <Button>SHOP NOW</Button>
        </Info>
    </Container>
  )
}

export default CategoryItem
